import React, { useState, useContext, useEffect } from 'react';
import { Navigate, useNavigate, Route, Routes } from 'react-router-dom';
import MainLayout from '../layouts/MainLayout';
import { useAuth, AuthProvider, ProtectedRoute } from '../context/authcontext';


import UsuariosPage from '../pages/usuarios/usuariosPage';
import { CommonProvider } from '../context/commonContext';
import OrganizacionesPage from '../pages/organizaciones/organizacionesPage';
import Logout from '../pages/auth/logout';
import Login from '../pages/auth/login';


const MainRoutes = () => {


    const auth = useAuth();
    const navigate = useNavigate();


    return (
        //AUTHPROVIDER PARA CHECKEAR SI ESTÁ AUTENTICADO
        <AuthProvider>
            <CommonProvider>
                <Routes>
                    <Route element={<MainLayout />}>
                        <Route path='/' element={<UsuariosPage />} exact />
                        <Route path='/organizations' element={<OrganizacionesPage />} exact />
                    </Route >
                    <Route path="/logout" element={<Logout />} />
                    <Route path="/login" element={<Login />} />
                    {/* 
                    <Route path="*" element={<Navigate to="/errors/404" replace />} />
                    <Route path="unauthorized" element={<Unauthorized />} /> */}
                </Routes >
            </CommonProvider >
        </AuthProvider>

    );




};

export default MainRoutes;
